import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import Snacks from './Snacks'

function SnacksCard() {
  const SnacksCards = useSelector(state => state.Snackscard.SnacksCards)
  const dispatch = useDispatch()

  React.useEffect(() => {
    axios
      .get('https://demo5518646.mockable.io/SnacksCard')
      .then((res) => { dispatch(setSnacksCards(res.data)) })
  })

  return <Snacks />
}

export default SnacksCard
